import React from 'react';

const Greeting = () => {
    const time = 14;
    return (
        <div className="greeting">
            <h1>Good morning</h1>
            {time>=12 ? <h2>Good Afternoon</h2> : <h2>Good Morning</h2>}
        </div>
    );
};

export default Greeting;
